package com.qhc.frye.domain;import java.util.Date;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.Table;/** *  *  <br>  * * @author walker */@Entity@Table(name = "k_order_version_view")public class KOrderVersionView {	/* Column(sequence_number) - 序列号 */	@Column(name="sequence_number",columnDefinition="CHAR",length=12)	private String sequenceNumber = null;	/* Column(order_id) - OrderId */	@Column(name="order_id",columnDefinition="CHAR",length=32)	private String orderId = null;	/* Column(version_id) - VersionId */	@Id	@Column(name="version_id",columnDefinition="CHAR",length=32)	private String versionId = null;	/* Column(version) - 版本名称 */	@Column(name="version")	private String version = null;	/* Column(status) - 0:saved
1:draft:submit to headquater
2.approving:BPM
3.approved */	@Column(name = "status", columnDefinition = "CHAR", length = 2)	private String status;	/* Column(create_time) - 版本创建时间 */	@Column(name="create_time")	private Date createTime = null;	/* Column(opt_time) - submitDate */	@Column(name="submit_date")	private Date submitDate = null;	/* Column(opt_time) - bpmSubmitTime */	@Column(name="bpm_submit_time")	private Date bpmSubmitTime = null;	/* Column(opt_time) - OptTime */	@Column(name="opt_time")	private Date optTime = null;	/* Column(order_info_id) - OrderInfoId */	@Column(name="order_info_id",columnDefinition="CHAR",length=32)	private String orderInfoId = null;	public KOrderVersionView(){	}	public String getSequenceNumber() {		return this.sequenceNumber;	}	public void setSequenceNumber(String sequenceNumber) {		this.sequenceNumber = sequenceNumber;	}	 	public String getOrderId() {		return this.orderId;	}	public void setOrderId(String orderId) {		this.orderId = orderId;	}	 	public String getVersionId() {		return this.versionId;	}	public void setVersionId(String versionId) {		this.versionId = versionId;	}	 	public String getVersion() {		return this.version;	}	public void setVersion(String version) {		this.version = version;	}	 	public String getStatus() {		return this.status;	}	public void setStatus(String status) {		this.status = status;	}	 	public Date getCreateTime() {		return this.createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	 	public Date getSubmitDate() {		return submitDate;	}	public void setSubmitDate(Date submitDate) {		this.submitDate = submitDate;	}	public Date getBpmSubmitTime() {		return bpmSubmitTime;	}	public void setBpmSubmitTime(Date bpmSubmitTime) {		this.bpmSubmitTime = bpmSubmitTime;	}	public Date getOptTime() {		return this.optTime;	}	public void setOptTime(Date optTime) {		this.optTime = optTime;	}	 	public String getOrderInfoId() {		return this.orderInfoId;	}	public void setOrderInfoId(String orderInfoId) {		this.orderInfoId = orderInfoId;	}	 	@Override	public int hashCode() {		final int prime = 31;		int result = 1;		result = prime * result + ((sequenceNumber == null) ? 0 : sequenceNumber.hashCode());		result = prime * result + ((orderId == null) ? 0 : orderId.hashCode());		result = prime * result + ((versionId == null) ? 0 : versionId.hashCode());		result = prime * result + ((version == null) ? 0 : version.hashCode());		result = prime * result + ((status == null) ? 0 : status.hashCode());		result = prime * result + ((createTime == null) ? 0 : createTime.hashCode());		result = prime * result + ((optTime == null) ? 0 : optTime.hashCode());		result = prime * result + ((orderInfoId == null) ? 0 : orderInfoId.hashCode());		return result;	}	@Override	public boolean equals(Object obj) {		if (this == obj) {			return true;		}		if (obj == null) {			return false;		}		if (getClass() != obj.getClass()) {			return false;		}		final KOrderVersionView other = (KOrderVersionView) obj;		return (this.sequenceNumber == null ? other.sequenceNumber == null : this.sequenceNumber.equals(other.sequenceNumber))			&&(this.orderId == null ? other.orderId == null : this.orderId.equals(other.orderId))			&&(this.versionId == null ? other.versionId == null : this.versionId.equals(other.versionId))			&&(this.version == null ? other.version == null : this.version.equals(other.version))			&&(this.status == null ? other.status == null : this.status.equals(other.status))			&&(this.createTime == null ? other.createTime == null : this.createTime.equals(other.createTime))			&&(this.optTime == null ? other.optTime == null : this.optTime.equals(other.optTime))			&&(this.orderInfoId == null ? other.orderInfoId == null : this.orderInfoId.equals(other.orderInfoId));	}		public String toString() {	    final String tab = "  ";	    String str = "";	    str = "KOrderVersionView ( "	        + "sequenceNumber = " + this.sequenceNumber + tab	        + "orderId = " + this.orderId + tab	        + "versionId = " + this.versionId + tab	        + "version = " + this.version + tab	        + "status = " + this.status + tab	        + "createTime = " + this.createTime + tab	        + "optTime = " + this.optTime + tab	        + "orderInfoId = " + this.orderInfoId + tab	        + " )";		    return str;	}}